  const [covid, setCovid] = useState({})

  useEffect(() => {
    getCovid()
  }, []
  )

  const getCovid = async () => {
    const result = await axios.get('')
    setCovid(result.data)
  }

  console.log(covid)
  return (
    <div className='App'>
      <Nevbar />
    </div>
